import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export default function Navbar() {
  return (
    <View style={styles.wrapper}>
      <View style={styles.navbar}>
        <Text style={styles.navItem}>Home</Text>
        <Text style={styles.navItem}>Men</Text>
        <Text style={styles.navItem}>Women</Text>
        <Text style={styles.navItem}>Electronics</Text>
        <Text style={styles.navItem}>Kids</Text>
        <Text style={styles.navItem}>Home-Decor</Text>
        <Text style={styles.navItem}>Profile</Text>
      </View>
      <View style={styles.logo}>
        <Text style={styles.logoText}>KMART</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  wrapper: {
    backgroundColor: 'darkslategray', // Dark background color for the entire navbar
  },
  navbar: {
    flexDirection: 'row',
    justifyContent: 'space-between', // Space between items
    alignItems: 'center',
    paddingHorizontal: 10, // Add padding to the navbar
    height: 60, // Height of the navigation bar
  },
  navItem: {
    color: 'white', // White text color
    marginHorizontal: 10, // Add horizontal spacing between items
    fontSize: 18, // Adjust font size as needed
  },
  logo: {
    backgroundColor: 'orange', // Orange background for the logo container
    padding: 10, // Add padding to the logo container
    borderRadius: 5, // Add a border radius for rounded corners
  },
  logoText: {
    color: 'white', // White text color for the logo
    fontSize: 18, // Adjust font size as needed
  },
});
